  false,\n\t\"url\": null,\n\t\"notes\": \"Utilizing volunteers, a Restoration Coordinator,
  and a seasonal AmeriCorps/STEP position, this project's goal is to: Continue surveillance,
  recording, and removal of all occurrences of Ricefield Bulrush on Ridgefield National
  Wildlife Refuge (NWR). Continue new surveillance, early detection, mapping and treatment
  of Refuge habitat for blackberry, purple loosestrife, indigobush, yellow water iris,
  fragrant water lily, and other key and new invasive plants. Collect and analyze
  data from current ricefield bulrush study area and expand to increase validity of
  the study. Continue riparian restoration along Gee Creek. Treat reed canarygrass,
  blackberry and indigobush on Steigerwald and Pierce NWRs. Train volunteers on herbicide
  application, invasive plant identification and ATV use for invasive removal and
  habitatrestoration projects, and engage new volunteers and partners in Refuge habitat
  projects.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
